import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
import App from './App';
import DrawerLayout from './components/layout/Drawer/DrawerLayout'

ReactDOM.render(
  <React.StrictMode>
    <DrawerLayout>
    <App />
    </DrawerLayout>
  </React.StrictMode>,
  document.getElementById('root')
);
